import React from "react";
import Bagpack from "../../assets/bagpack.jpg";

function Bag() {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
      }}
    >
      <img src={Bagpack} width="30%" height="30%" />
    </div>
  );
}

export default Bag;
